var CurrentPage=function(){var n=function(){var n=$(".login-form");n.validate({rules:{username:{required:!0},password:{required:!0}}});n.find("input").keypress(function(n){if(n.which==13)return $(".login-form").valid()&&$(".login-form").submit(),!1});n.submit(function(t){(t.preventDefault(),$(".login-form").valid())&&abp.ui.setBusy(null,abp.ajax({contentType:app.consts.contentTypes.formUrlencoded,url:n.attr("action"),data:n.serialize()}))});$("a.social-login-icon").click(function(){var n=$(this),t=n.closest("form");t.find("input[name=provider]").val(n.attr("data-provider"));t.submit()});n.find("input[name=returnUrlHash]").val(location.hash);$("input[type=text]").first().focus()};return{init:function(){n()}}}();